function GetData(regionId, categoryId) {
  return CustomData_new.filter(function(el) {
    return el.Region_id == regionId &&
    el.cadran_id == categoryId
  })
}

function GetColor(element) {
  var arr = ["#2078ff", "#f83098", "#7030a0", "#00fa00"];
  var selectColor;
  switch(element) {
    case 'FM':
      selectColor = arr[0];
      break;
    case 'TN':
      selectColor = arr[1];
      break;
    case 'FD':
      selectColor = arr[2];
      break;
    case 'O':
      selectColor = arr[3];
      break;
  }
  return selectColor;
}